import React from 'react';
import MovieList from './MovieList.js';

class DefaultView extends React.Component {


    render()
    {
        return(
           <section>
                <MovieList movies={this.props.movies} addFav={this.addFav}/>
            </section>
        );
    }
}

export default DefaultView;
